import React from "react";

const Book = () => {
    return (
    <div>
        <div class="container">
            <img src='./book.jpg' alt="123" class="book"></img>
            <h1>Кафе на краю земли</h1>
            <h4>Автор: Джон П. Стрелеки</h4>
            <h4>Жанр: Литература по саморазвитию</h4>
            <h4>Кол. страниц: 160</h4>
        </div>

        <div class="reviews">
            <p>Книга очень понравилась, читается легко, сюжет захватывает с первых строк. <br/>
                Описано много очевидных вещей, на которые мы тратим своё время и свою энергию, <br/>
                но которые в дейтствительности не имеют решающего значения в поиске гармонии и счастья. <br/>
                Рекомендую к прочтению всем, кто стоит на распутье.</p>
        </div>
    </div>
    );
};

export default Book;
